import { StyleSheet, Text, View, Button } from 'react-native';



const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFF',
    alignItems: 'right',
    justifyContent: 'right',
  },
  space: {
    width: 20,
    height: 100,
  },
});


export default styles;
